  true,\n\t\"url\": null,\n\t\"notes\": \"<p>SEER Limited-Use cancer incidence data
  with associated population data. Geographic areas available are county and SEER
  registry.  The Surveillance, Epidemiology, and End Results (SEER) Program of the
  National Cancer Institute collects and distributes high quality, comprehensive cancer
  data from a number of population-based cancer registries. Data include patient demographics,
  primary tumor site, morphology, stage at diagnosis, first course of treatment, and
  follow-up for vital status. The SEER Program is the only comprehensive source of
  population-based information in the United States that includes stage of cancer
  at the time of diagnosis and survival rates within each stage.</p>n\",\n\t\"license_title\":
